import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';
import {Button, Form, Nav, NavDropdown} from "react-bootstrap";
import logo from '../resources/logo.png';
import theme from "../common/Theme";
import NavbarCollapse from "react-bootstrap/NavbarCollapse";
import NavbarToggle from "react-bootstrap/NavbarToggle";

export default function Header() {
    return (
        <>
            <Navbar expand="lg"  fixed="top" style={{backgroundColor: theme.dark}} variant="dark" bg="dark">
                <Container className="col-12" style={{maxWidth: "none"}}>
                    <Navbar.Brand style={{overflow: "hidden"}} >
                        <img src={logo} alt="fatEar " width="60"  className="d-inline-block align-top" style={{marginLeft: 30, position:"relative", left: "-10px", transform: "scale(2.2)"}}/>
                    </Navbar.Brand>
                    <NavbarToggle aria-controls="responsive-navbar-nav" style={{backgroundColor:theme.peach}}></NavbarToggle>
                    <NavbarCollapse id="responsive-navbar-nav">
                        <Nav className="d-flex m-auto col-4">
                            <Form className="d-flex col-12">
                                {/* eslint-disable-next-line react/jsx-no-undef */}
                                <Form.Control
                                    type="search"
                                    placeholder="Search"
                                    className="me-3"
                                    aria-label="Search"
                                    style={{minWidth:"150px"}}
                                />
                                <Button variant="outline-dark" style={{backgroundColor:theme.peach}}>Search</Button>
                            </Form>
                        </Nav>

                        <Nav>
                            <Nav.Item>
                                Log in

                            </Nav.Item>
                            <Nav.Item>
                                <p >Register</p>
                            </Nav.Item>
                        </Nav>
                    </NavbarCollapse>




                </Container>
            </Navbar>


        </>
    );
};
